import React from 'react';
import Cards from '../components/Cards';
import Navigation from '../components/Navigation';
import Title from '../components/Title';

const Home = () => {
    return (
        <div>
            <Title />
            <Navigation />
            <Cards />
            <h1>HOME</h1>
        </div>
    );
};

export default Home;
